import React from 'react';

function PopupWithForm(props) {
    return(
        <div className={`popup popup-${props.name} ${props.isOpen && 'popup_opened'}`}>
            <button type="button" name="close-button" className="popup__close-button popup-user__close-button"></button>
            <form className="popup__form popup-user__form" noValidate>
                <h3 className={`popup-${props.name}__title`}>`${props.title}`</h3>
                {props.children}
                <button type="submit" className=" popup-user__save-button popup__button" name="save-button">Сохранить</button>
            </form>
        </div>
    );
}

export default PopupWithForm;
